mapper.select:
select 
 
  from sys_table_encode where (1=1) and status = '0' 
  
    and table_encode_name like '%${tableEncodeName}%' 
   
   
    and table_encode_project_id = #{tableEncodeProjectId} 
   
   
    and table_encode_project_code = #{tableEncodeProjectCode} 
   
   
     and table_encode_annotation = #{tableEncodeAnnotation}

select count(*) from sys_table_encode where 1=1 and status = '0' 

   and table_encode_name like '%${tableEncodeName}%' 
  
  
   and table_encode_project_id = #{tableEncodeProjectId} 
  
  
   and table_encode_project_code = #{tableEncodeProjectCode}
